function toSelectOptions(obj) {
	let html = '';
	for (var key in obj) {
		html += '<option value=' + key  + '>' + obj[key].nome + '</option>';
	}
	document.getElementById('filterSelect').innerHTML = html;
}

function sortByKey(array, key) {
  return array.sort(function(a, b) {
    var x = a[key];
    var y = b[key];
    return ((x < y) ? -1 : ((x > y) ? 1 : 0));
  });
}

function nFrmt(number) {
	return number.toFixed(1).toString().replace('.', ',');
}
